// Navbar.js
import React from 'react';
import styled from 'styled-components';
import { CiSearch, CiShoppingCart ,  CiUser } from "react-icons/ci";

const Navbar = () => {
  return (
    <Nav>
      <NavLeft>
        <NavItem href="#">Store</NavItem>
        <NavItem href="#">Phones</NavItem>
        <NavItem href="#">Tablets</NavItem>
        <NavItem href="#">TV & Smart Home</NavItem>
        <NavItem href="#">Smart Watch & Audio</NavItem>
      </NavLeft>
      <NavRight>
        <NavItem href="#">Discover</NavItem>
        <NavItem href="#">Support</NavItem>
        <NavItem href='#'><CiSearch /></NavItem>
        <NavItem href='#'><CiShoppingCart /></NavItem>
        <NavItem href='#'><CiShoppingCart /></NavItem>
        <NavItem href='#'><CiUser /></NavItem>
      </NavRight>
    </Nav>
  );
};

export default Navbar;

// Styled Components
const Nav = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px 20px;
  background-color: white;
  border-bottom: 1px solid #e0e0e0;
  position: sticky;
  top: 0;
  z-index: 100;
`;

const NavLeft = styled.div`
  display: flex;
  gap: 15px;

  @media (max-width: 768px) {
    display: none; /* Hide on small screens */
  }
`;

const NavRight = styled.div`
  display: flex;
  align-items: center;
  gap: 15px;
`;

const NavItem = styled.a`
  text-decoration: none;
  color: black;
  font-size: 14px;
  cursor: pointer;

  &:hover {
    color: #007bff;
  }
`;

const NavIcon = styled.i`
  font-size: 18px;
  cursor: pointer;

  &:hover {
    color: #007bff;
  }
`;
